### Problem13
Suppose you want to create your own data type of Complex. Below is the code you wrote. There are now two constructors. What is wrong with the Constructor? 

```java
class Complex{
    double re;
    double im;

    // Constructor 1
    public void Complex(double Cre, double Cim){
        re = Cre;
        im = Cim;
    }

    // Constructor 2
    public Complex(){
        this.re = 1;
        this.im = 1;
    }


    public static void main(String[] args) {
        Complex a = new Complex(1.0,2.0);
        System.out.println(a.re);
    }
}
```

a. The 're' and 'im' in the constructor 1 are not defined.

b. The first construtor should not have any return type, even void.

c. The Complex class cannot have two constructors.

d. None of the above.
